css:
.react-tabs {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.react-tabs__tab-panel--selected {
  flex: 1;
  overflow: auto;
}
.github-tab {
  padding: 5px 15px;
  text-align: center;
  font-weight: 600;
  color: rgba(117, 123, 134, 0.7375);
  cursor: default;
  user-select: none;
}
.github-tablist {
  flex: none;
  display: flex;
  justify-content: center;
  padding: 0;
  margin: 0;
  list-style: none;
  border-bottom: 1px solid transparent;
  background-color: #282c34;
}
.github-tab-icon {
  color: rgba(65, 70, 79, 0.8845);
  vertical-align: middle;
}
.github-tab-icon:before {
  margin-right: .4em;
}
.github-tab-count {
  display: inline-block;
  background-color: rgba(47, 51, 59, 0.87);
  border-radius: 0px;
  padding: 0 .25em;
  margin-left: 5px;
}
.github-tab.react-tabs__tab--selected {
  color: #ffffff;
  box-shadow: 0 1px 0 #282c34;
}
.github-tab.react-tabs__tab--selected .github-tab-icon {
  color: rgba(171, 178, 191, 0.65);
}
